import React from 'react';
import { motion } from 'framer-motion';

const Hero = () => {
  return (
    <section className="relative h-screen overflow-hidden pt-16 bg-white">
      {/* Efectos de luces sutiles como humo en los lados */}
      <div className="absolute inset-0 pointer-events-none">
        {/* Humo izquierdo - Verde y Amarillo */}
        <motion.div
          className="absolute top-0 -left-48 w-96 h-full bg-gradient-to-r from-neurops-green/15 via-neurops-yellow/10 to-transparent"
          style={{
            clipPath: 'ellipse(60% 80% at 0% 50%)',
            filter: 'blur(40px)'
          }}
          initial={{ opacity: 0, x: -50 }}
          animate={{ 
            opacity: [0.2, 0.4, 0.2],
            x: [-50, -20, -50],
            scaleY: [0.8, 1.2, 0.8]
          }}
          transition={{
            duration: 12,
            repeat: Infinity,
            ease: "easeInOut"
          }}
        />

        {/* Humo izquierdo secundario - Naranja */}
        <motion.div
          className="absolute bottom-0 -left-32 w-80 h-96 bg-gradient-to-tr from-neurops-orange/12 via-neurops-green/8 to-transparent"
          style={{
            clipPath: 'ellipse(70% 60% at 20% 80%)',
            filter: 'blur(35px)'
          }}
          initial={{ opacity: 0, y: 30 }}
          animate={{ 
            opacity: [0.15, 0.3, 0.15],
            y: [30, 0, 30],
            scaleX: [0.9, 1.1, 0.9]
          }}
          transition={{
            duration: 10,
            repeat: Infinity,
            ease: "easeInOut",
            delay: 2
          }}
        />

        {/* Humo derecho - Azul Royal y Azul claro */}
        <motion.div
          className="absolute top-0 -right-48 w-96 h-full bg-gradient-to-l from-neurops-royal/18 via-neurops-blue/12 to-transparent"
          style={{
            clipPath: 'ellipse(60% 85% at 100% 45%)',
            filter: 'blur(45px)'
          }}
          initial={{ opacity: 0, x: 50 }}
          animate={{ 
            opacity: [0.2, 0.5, 0.2],
            x: [50, 20, 50],
            scaleY: [0.9, 1.1, 0.9]
          }}
          transition={{
            duration: 8,
            repeat: Infinity,
            ease: "easeInOut",
            delay: 1
          }}
        />

        {/* Humo derecho secundario - Rojo */}
        <motion.div
          className="absolute bottom-0 -right-32 w-72 h-80 bg-gradient-to-tl from-neurops-red/10 via-neurops-royal/8 to-transparent"
          style={{
            clipPath: 'ellipse(65% 70% at 80% 85%)',
            filter: 'blur(30px)'
          }}
          initial={{ opacity: 0, y: 20 }}
          animate={{ 
            opacity: [0.1, 0.25, 0.1],
            y: [20, -10, 20],
            scaleX: [0.8, 1.2, 0.8]
          }}
          transition={{
            duration: 14,
            repeat: Infinity,
            ease: "easeInOut",
            delay: 3.5
          }}
        />

        {/* Humo central superior sutil */}
        <motion.div
          className="absolute top-16 left-1/4 w-64 h-48 bg-gradient-to-b from-neurops-yellow/8 via-neurops-green/5 to-transparent"
          style={{
            clipPath: 'ellipse(80% 60% at 50% 0%)',
            filter: 'blur(25px)'
          }}
          initial={{ opacity: 0, scale: 0.7 }}
          animate={{ 
            opacity: [0.05, 0.2, 0.05],
            scale: [0.7, 1, 0.7],
            y: [0, 15, 0]
          }}
          transition={{
            duration: 16,
            repeat: Infinity,
            ease: "easeInOut",
            delay: 5
          }}
        />

        {/* Humo central inferior sutil */}
        <motion.div
          className="absolute bottom-16 right-1/4 w-56 h-40 bg-gradient-to-t from-neurops-blue/8 via-neurops-royal/5 to-transparent"
          style={{
            clipPath: 'ellipse(75% 65% at 50% 100%)',
            filter: 'blur(28px)'
          }}
          initial={{ opacity: 0, scale: 0.8 }}
          animate={{ 
            opacity: [0.05, 0.18, 0.05],
            scale: [0.8, 1.1, 0.8],
            y: [0, -12, 0]
          }}
          transition={{
            duration: 13,
            repeat: Infinity,
            ease: "easeInOut",
            delay: 4
          }}
        />
      </div>

      {/* Imagen de fondo centrada con bordes redondeados */}
      <motion.div
        className="absolute top-20 left-16 right-16 bottom-20 rounded-3xl overflow-hidden z-10"
        initial={{ scale: 1.1 }}
        animate={{ scale: 1 }}
        transition={{ duration: 1.5, ease: "easeOut" }}
      >
        {/* Imagen de fondo */}
        <div 
          className="absolute inset-0 bg-cover bg-center bg-no-repeat"
          style={{ backgroundImage: 'url(/firstsection.jpg)' }}
        />

        {/* Overlay sutil para mejor legibilidad */}
        <div className="absolute inset-0 bg-black/10" />
      </motion.div>

        {/* Cuadro de bienvenida integrado como cuadrado grande en esquina inferior izquierda */}
        <motion.div
          className="absolute bottom-20 left-16 w-400 h-80 bg-white rounded-tr-3xl p-16 flex flex-col justify-center z-20"
        initial={{ opacity: 0, y: 50, x: -50 }}
        animate={{ opacity: 1, y: 0, x: 0 }}
        transition={{ duration: 1, delay: 0.5, ease: "easeOut" }}
      >
        {/* Mensaje de bienvenida corto */}
        <motion.h1
          className="font-serif text-5xl font-bold text-neurops-black mb-8 leading-tight"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.8 }}
        >
          Bienvenido a{' '}
          <span className="text-neurops-black block font-black text-6xl">
            Neurops
          </span>
        </motion.h1>

        {/* Texto subrayado con flecha */}
        <motion.div
          className="group cursor-pointer"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 1 }}
          whileHover={{ scale: 1.02 }}
        >
          <div className="flex items-center space-x-2">
            <span className="font-serif text-2xl text-neurops-black font-normal relative">
              Agenda tu cita
              <motion.div
                className="absolute bottom-0 left-0 h-0.5 bg-neurops-black"
                initial={{ width: 0 }}
                animate={{ width: "100%" }}
                transition={{ duration: 0.8, delay: 1.2 }}
              />
            </span>
            <motion.svg
              className="w-8 h-8 text-neurops-black"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              initial={{ x: 0 }}
              animate={{ x: [0, 4, 0] }}
              transition={{ 
                duration: 2,
                repeat: Infinity,
                ease: "easeInOut",
                delay: 1.5
              }}
            >
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17 8l4 4m0 0l-4 4m4-4H3" />
            </motion.svg>
          </div>
        </motion.div>

      </motion.div>

      {/* Indicador de scroll */}
      <motion.div
        className="absolute bottom-32 right-24 flex flex-col items-center text-gray-400 z-20"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1, delay: 2 }}
      >
        <span className="text-xs font-serif mb-2 rotate-90 origin-center">Scroll</span>
        <motion.div
          className="w-px h-16 bg-gray-400/50"
          animate={{ scaleY: [1, 0.5, 1] }}
          transition={{ 
            duration: 2,
            repeat: Infinity,
            ease: "easeInOut"
          }}
        />
      </motion.div>

    </section>
  );
};

export default Hero;
